import React, { Component } from "react";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
       import DonorHome from "./DonorHome";
      // import fRegistration from "./Registration";
      import CompanyNavbar from "./DonorNavbar";
      import Category from "./Category";
      import QuickModel from "./QuickModel";

export default class DonorFunction extends Component {
  state = {
    users: [],
    doctors: [],
    category: [],
  };

  getCategory = async () => {
    const config = {
      headers: {
        "Content-Type": "application/json",
      },
    };
    try {
      const res = await axios.get(
        "http://localhost:5000/api/v1/category/",
        config
      );
      this.setState({
        category: res.data.data,
      });
    } catch (err) {
      console.log("Can't load the items");
    }
  };

  render() {
    return (



          <Router>
            <div className="">
              <CompanyNavbar />
              {/* <div className="jumbotron" style={{ marginBottom: 0 + "px" }}></div> */}

              <Switch>
                <Route exact path={"/donor/Home"} component={DonorHome} />
                {/* <Route path={"/vendor/fsignup"} component={fRegistration} /> */}
                <Route exact path={"/donor/Category"} component={Category} />
                <Route path={"/user/ShowDoctor"} component={QuickModel} />
              </Switch>
            </div>
          </Router>
        );
      }
}
